import {React, useState } from "react";
//styles
import {PopUpStyle} from './Form.styles'
import MoveBike from "../MoveBike";
export default function PopUp(props) {
    let content;
    let whatToShow;

    if (props.PopupInfo && props.PopupInfo.content ) {
        content = props.PopupInfo.content
        whatToShow = props.PopupInfo.whatToShow
    }

	return (
		<PopUpStyle >
        { whatToShow === "Scooter" ? (
            <>
            <div> <p>Scooter ID: </p>{content._id} <p> Batteri: </p> {content.battery}</div>
            <div> <p>Stad: </p> {content.city_location} </div>
            <div> Position: Latitude {content.position.lat} Longitude: {content.position.lng} </div>
            <div> <p> Hastighet </p>{content.speed} </div>
            <div> <p> Starttid </p>{content.start_time} </div>
            <MoveBike 
                id = {content._id}
                city = {content.city_location}
                position = {content.position}
                battery = {content.battery}
                speed = {content.speed}
                >
            </MoveBike>
            </>
            ) : null }

        { whatToShow === "City" ? (
            <>
            <div> <p>Stad</p> {content.city}</div>
            <div><p> Antal cyklar </p>{content.amount_of_bikes} </div>
            </>
            ) : null } 

        {  whatToShow === "LoadStation" ? (
            <>
            <div> <p>Position:</p> (Visar endast 2 av positionerna nu
                {content.position.polygonePart1.lat }
                { content.position.polygonePart2.lng }
            </div>
            <div><p> Antal cyklar</p> ??????</div>
            </>
            ) : null } 
		</PopUpStyle>	
	);
}









